        <h3> {props.image}</h3>
        <h4 className="title">
          <b>{props.listName}</b>
        </h4>
        <h6 className="bodyPost">
          <i>{props.description}</i>
        </h6>
        <button className="buttonRem" onClick={(event6)=>propsonClick(props.postId)}>
          <FaRegTrashAlt />
        </button>
      </fieldset>
    </div>
  );
};

export default Task;
